import React, { useEffect } from "react";
import axios from "axios";

function TopApps(){
    useEffect(()=>{
        axios.get("http://localhost:8080/topfreeapps")
        .then((response)=>{
            console.log(response.data)
        })
    },[])
    return(
        <div className="TopApps">
            TopApps
        </div>
    )
}

export default TopApps
